.collect-page {
    padding: 50px 15px 10px;
    .collect-item{
        padding: 15px 0;
        display: flex;
        .collect-img-box{
            width: 120px;
            height: 100px;
            overflow: hidden;
            position: relative;
            .collect-img{
                position: relative;
                top:50%;
                left:50%;
                transform: translate(-50%,-50%);
                transform-origin:50% 50%;
                display: block;
                width: auto;
                height: 100px;
            }
        }
        .collect-info{
            margin-left:15px;
            flex: 1;
            .collect-name{
                height: 48px;
                line-height: 24px;
                overflow: hidden;
                font-size: 16px;
                margin-bottom: 4px;
            }
        }

    }
}
